window.bookSummaryJSON = "<p>A complete collection of the four Vegas romances in the Drive Me Wild series. </p> <p>Including <i>Ms. Fortune</i>, <i>Ms. Chief</i>, <i>Ms. Lead</i>, and <i>Ms. Take</i>. </p> <p><i>Ms. Fortune</i>: There are a lot of ways to impress Normandy Blake. Unfortunately for Brandon Carmichael, being a billionaire isn't one of them. </p> <p><i>Ms. Chief</i>: A lot can change in the years after high school. But a lot can stay the same too. For Chelsie Blake, it's both. </p> <p><i>Ms. Lead</i>: Opposites attract, but similarities bind. And to find out those similarities, you need to communicate. </p> <p><i>Ms. Take</i>: Alcohol and bad decisions go together like tacos and Tuesdays, especially in Vegas, where bad choices are buy-one-get-one-free.</p>"; 
